import { motion, useAnimation, AnimatePresence } from 'framer-motion';
import { useState } from 'react';

export const Example = () => {
  const [activeDemo, setActiveDemo] = useState(null);
  const controls = useAnimation();
  const [isOpen, setIsOpen] = useState(false);

  const demos = [
    {
      title: "Drag Playground 🎯",
      color: "bg-gradient-to-r from-purple-500 to-pink-500",
      content: (
        <div className="flex flex-wrap gap-8 justify-center min-h-[400px] relative bg-black/20 rounded-xl p-8">
          {/* Basic Drag */}
          <motion.div
            drag
            dragConstraints={{
              top: -100,
              left: -100,
              right: 100,
              bottom: 100
            }}
            className="w-32 h-32 bg-gradient-to-r from-purple-500 to-pink-500 rounded-xl flex items-center justify-center cursor-grab active:cursor-grabbing"
            whileDrag={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="text-white font-bold">Drag Me!</span>
          </motion.div>

          {/* Elastic Drag */}
          <motion.div
            drag
            dragElastic={0.5}
            dragConstraints={{
              top: -100,
              left: -100,
              right: 100,
              bottom: 100
            }}
            className="w-32 h-32 bg-gradient-to-r from-blue-500 to-purple-500 rounded-xl flex items-center justify-center cursor-grab active:cursor-grabbing"
            whileDrag={{ scale: 1.1, rotate: 180 }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="text-white font-bold">Elastic!</span>
          </motion.div>

          {/* Axis Lock Drag */}
          <motion.div
            drag="x"
            dragConstraints={{
              left: -100,
              right: 100
            }}
            className="w-32 h-32 bg-gradient-to-r from-green-500 to-yellow-500 rounded-xl flex items-center justify-center cursor-grab active:cursor-grabbing"
            whileDrag={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="text-white font-bold">X-Axis Only</span>
          </motion.div>

          {/* Momentum Drag */}
          <motion.div
            drag
            dragConstraints={{
              top: -100,
              left: -100,
              right: 100,
              bottom: 100
            }}
            dragTransition={{ bounceStiffness: 600, bounceDamping: 10 }}
            className="w-32 h-32 bg-gradient-to-r from-red-500 to-orange-500 rounded-xl flex items-center justify-center cursor-grab active:cursor-grabbing"
            whileDrag={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="text-white font-bold">Momentum</span>
          </motion.div>
        </div>
      )
    },
    {
      title: "Chain Reaction 🔄",
      color: "bg-gradient-to-r from-blue-500 to-teal-500",
      content: (
        <div className="grid grid-cols-4 gap-2 p-4">
          {[...Array(16)].map((_, i) => {
            const row = Math.floor(i / 4);
            const col = i % 4;

            return (
              <motion.div
                key={i}
                className="aspect-square bg-white/20 rounded-lg cursor-pointer"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
                onClick={async () => {
                  controls.start(`cell${i}`, {
                    scale: [1, 1.4, 1],
                    rotate: 360,
                    transition: { duration: 0.5 }
                  });

                  const neighbors = [];
                  if (row > 0) neighbors.push(i - 4);
                  if (row < 3) neighbors.push(i + 4);
                  if (col > 0) neighbors.push(i - 1);
                  if (col < 3) neighbors.push(i + 1);

                  neighbors.forEach((n, index) => {
                    controls.start(`cell${n}`, {
                      scale: [1, 1.2, 1],
                      rotate: 180,
                      transition: { 
                        duration: 0.3,
                        delay: 0.1 * (index + 1)
                      }
                    });
                  });
                }}
                animate={controls}
                custom={`cell${i}`}
              />
            );
          })}
        </div>
      )
    },
    {
      title: "Particle Field ✨",
      color: "bg-gradient-to-r from-green-500 to-yellow-500",
      content: (
        <div className="relative h-[300px] bg-black/20 rounded-lg overflow-hidden">
          {[...Array(30)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute w-2 h-2 bg-white/40 rounded-full"
              animate={{
                x: [0, Math.random() * 400 - 200],
                y: [0, Math.random() * 300 - 150],
                scale: [1, Math.random() + 0.5, 1],
                opacity: [0.4, 1, 0.4],
              }}
              transition={{
                duration: 2 + Math.random() * 2,
                repeat: Infinity,
                repeatType: "reverse",
                ease: "easeInOut"
              }}
              style={{
                left: `${Math.random() * 100}%`,
                top: `${Math.random() * 100}%`,
              }}
              whileHover={{
                scale: 2,
                backgroundColor: "rgba(255,255,255,0.8)",
              }}
            />
          ))}
        </div>
      )
    },
    {
      title: "Text Wave 📝",
      color: "bg-gradient-to-r from-red-500 to-orange-500",
      content: (
        <div className="flex justify-center items-center p-8">
          {"Hello World!".split('').map((char, i) => (
            <motion.span
              key={i}
              className="text-4xl font-bold inline-block"
              animate={{
                y: [0, -20, 0],
                scale: [1, 1.2, 1],
                color: ['#fff', '#ffaa00', '#fff']
              }}
              transition={{
                duration: 1.5,
                repeat: Infinity,
                delay: i * 0.1,
                ease: "easeInOut"
              }}
            >
              {char === ' ' ? '\u00A0' : char}
            </motion.span>
          ))}
        </div>
      )
    },
    {
      title: "Card Deck 🃏",
      color: "bg-gradient-to-r from-indigo-500 to-blue-500",
      content: (
        <div className="flex justify-center items-center p-8">
          {[...Array(5)].map((_, i) => (
            <motion.div
              key={i}
              className="w-32 h-48 bg-white rounded-xl absolute"
              initial={{ rotate: 0, x: 0 }}
              animate={{
                rotate: [-5 + i * 2.5, 5 + i * 2.5],
                y: [0, -5, 0]
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                repeatType: "reverse",
                delay: i * 0.1
              }}
              whileHover={{
                y: -50,
                rotate: 0,
                transition: { duration: 0.2 }
              }}
              style={{
                backgroundImage: 'linear-gradient(45deg, #f3f4f6 25%, #e5e7eb 25%, #e5e7eb 50%, #f3f4f6 50%, #f3f4f6 75%, #e5e7eb 75%, #e5e7eb 100%)',
                backgroundSize: '20px 20px'
              }}
            />
          ))}
        </div>
      )
    }
  ];

  return (
    <div className="flex flex-col items-center justify-center min-h-[600px] p-8">
      <div className="grid grid-cols-2 md:grid-cols-3 gap-4 mb-8 w-full max-w-4xl">
        {demos.map((demo, index) => (
          <motion.button
            key={index}
            className={`${demo.color} p-6 rounded-xl text-white font-bold text-lg shadow-lg`}
            whileHover={{ scale: 1.02, boxShadow: "0 10px 25px rgba(0,0,0,0.2)" }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setActiveDemo(activeDemo === index ? null : index)}
          >
            {demo.title}
          </motion.button>
        ))}
      </div>

      <AnimatePresence mode="wait">
        {activeDemo !== null && (
          <motion.div
            key={activeDemo}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className={`${demos[activeDemo].color} p-8 rounded-xl w-full max-w-4xl shadow-2xl`}
          >
            {demos[activeDemo].content}
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};
